import "../CSS/Chart.css";
import ChartBar from "./ChartBar";

function Chart(props) {

    const array = [1, 2, 3, 4];
    let sum = 0;
    
    for (let i = 0; i < array.length; i++) {
        sum += array[i];
    }
    console.log(sum); 
  return (
    <div className="chart">
      {props.dataPoints.map((dataPoint) => (
        <ChartBar key={dataPoint.label} value={dataPoint.value} maxValue={122} label={dataPoint.label}/>
      ))}
    </div>
  );
}

export default Chart;
